vent of any damages or losses occurring while using the services. The application is not responsible for any claims in this regard.\n\n 17. Cooperation with the authorities:\n\n - The application must cooperate with local authorities regarding investigations and information requested from it.\n\n 18. NOTICES AND COMMUNICATIONS:\n\n - The Application may send notifications and communications to users via email, text messages or other means for purposes such as platform updates and promotion of services.\n\n 19. Application of laws and disputes:\n\n In the event of any dispute between tenants and warehouse owners, the parties should try to resolve the dispute amicably first through communication and negotiation. If the dispute is not resolved amicably, the parties can resort to local laws and judicial system to resolve the dispute.\n\n 20. Updated policy and terms:\n\n The application development company reserves the right to amend or update the Terms and Conditions of Use. Users will be notified of any potential changes through the contact methods in the application':
      'السياسة وشروط الاستخدام لتطبيق الوساطة بين أصحاب المخازن والمستأجرين:تعريف التطبيق: \n\n   - تطبيق الوساطة هو منصة إلكترونية تعمل كوسيط بين أصحاب المخازن والمستأجرين. يتيح التطبيق لأصحاب المخازن عرض معلومات حول مساحة تخزينهم والخدمات التي يقدمونها، بينما يمكن للمستأجرين البحث عن مساحة تخزين مناسبة وإجراء حجوزاتالتسجيل والحسابات: \n\n   - يجب على جميع المستخدمين تسجيل حساباتهم في التطبيق باستخدام معلومات شخصية مثل الاسم وعنوان البريد الإلكتروني. \n\n - يجب على المستخدمين تقديم معلومات دقيقة وصحيحة أثناء عملية التسجيل لضمان تواصل سلس وفعال.  \n\n - يجب على المستخدمين الحفاظ على سرية معلومات حسابهم وعدم مشاركتها مع أي طرف ثالث.الحقوق والالتزامات:  \n\n - أصحاب المخازن ملزمون بتوفير معلومات دقيقة حول المخزن والخدمات المقدمة، بما في ذلك الأسعار والمدى الزمني.  \n\n - المستأجرين ملزمون بالامتثال للشروط والأحكام المعمول بها في التطبيق، بما في ذلك سياسة الإلغاء والتعويضات.الحجز والدفع:  \n\n - المستأجرين يجب أن يقوموا بإجراء الحجز عبر التطبيق وبموافقة أصحاب المخازن على الحجز.  \n\n - الدفع يجب أن يتم عبر وسائل الدفع المتاحة في التطبيق، مثل البطاقات الائتمانية أو طرق الدفع الإلكترونية  \n\n - سيتم تحصيل عمولة من المستأجرين عند استخدام خدمات التطبيق وسيتم دفعها إلى أصحاب المخازن.التأمين والمسؤولية:  \n\n - التطبيق قد يوفر خيارات للتأمين على الشحن والتخزين. يتحمل المستخدمون مسؤولية اختيار التأمين المناسب لاحتياجاتهم  \n\n - التطبيق ليس مسؤولًا عن أية أضرار أو خسائر تحدث خلال استخدام الخدمات المقدمة على المنصةإلغاء الحجز واسترداد الأموال: \n\n - يجب على المستخدمين الالتزام بسياسة إلغاء الحجز المعمول بها في التطبيق. سيتم تطبيق رسوم إلغاء على المستأجرين إذا تم إلغاء الحجز بعد فترة معينة.سياسة الخصوصية:  \n\n - سياسة الخصوصية تحدد كيفية جمع واستخدام المعلومات الشخصية في التطبيق. يجب على المستخدمين قراءة وفهم سياسة الخصوصية المعمول بها في التطبيق.إنهاء الحساب:  \n\n - يحق للتطبيق إنهاء حساب أي مستخدم ينتهك الشروط والأحكام أو يسبب إزعاجًا للآخرين. إنهاء الحساب قد يشمل الإيقاف المؤقت أو الدائم على سبيل المثال: \n\n تغيير الشروط والأحكام  \n\n - يمكن للتطبيق تغيير شروط وأحكام الاستخدام، وسيتم إشعار المستخدمين بأي تغييرات محتملة من خلال إشعارات أو تحديثات في التطبيق. \n\n الاتصال بنا : \n\n - يجب على المستخدمين الاتصال بفريق دعم التطبيق في حالة وجود أي استفسارات أو مشكلات أثناء استخدام التطبيق: \n\n تعديل أو إلغاء الحجز  \n\n - المستأجرين يمكنهم تعديل أو إلغاء حجوزاتهم وفقًا لسياسة تعديل وإلغاء الحجز المعمول بها في التطبيق. قد يتم تطبيق رسوم إلغاء على المستأجرين إذا تم إلغاء الحجز بعد فترة معينة:\n\n  تقييمات المستخدمين:  \n\n - المستخدمين يمكنهم تقديم تقييمات ومراجعات لأصحاب المخازن وخدماتهم. يجب على المستخدمين تقديم تقييمات صادقة وبناءة لتعزيز جودة الخدمات \n\n سلامة المعلومات : \n\n - يجب على المستخدمين توخي الحذر عند مشاركة معلومات حساسة مثل معلومات بطاقات الائتمان عبر التطبيق. التطبيق يجب أن يتوفر على إجراءات أمان لحماية المعلومات الشخصية.انتهاكات الحكام: \n\n  - يجب على المستخدمين الإبلاغ عن أي انتهاكات للشروط والأحكام أو مخالفات أمان على التطبيق. سيتم التحقيق في هذه البلاغات واتخاذ الإجراءات اللازمة \n\n قوانين محلية :  \n\n -. يجب على المستخدمين الامتثال للقوانين واللوائح المحلية المعمول بها في منطقتهم عند استخدام خدمات التطبيقتعويضات ومسؤوليات الطرفين: \n\n  - يجب على المستأجرين وأصحاب المخازن التوصل إلى اتفاق واضح بشأن التعويضات في حالة وقوع أي أضرار أو خسائر أثناء استخدام الخدمات. التطبيق غير مسؤول عن أية مطالبات في هذا الصدد \n\n الإشعارات والاتصالات: \n\n  - يمكن للتطبيق إرسال إشعارات واتصالات للمستخدمين عبر البريد الإلكتروني أو رسائل نصية أو وسائل أخرى لأغراض مثل تحديثات المنصة وترويج الخدمات \n\n  تطبيق القوانين والنزاعاتفي حالة وجود أي نزاع بين المستأجرين وأصحاب المخازن: \n\n يجب على الأطراف أن تحاول حل النزاع بشكل ودي أولاً عبر التواصل والتفاوضفي حالة عدم تسوية النزاع بشكل ودي، يمكن للأطراف اللجوء إلى القوانين والنظام القضائي المحلي لحل النزاعتحديث السياسة والشروط :\n\n تحتفظ شركة تطوير التطبيق بالحق في تعديل أو تحديث سياسة الحكام وشروط الاستخدام. سيتم إشعار المستخدمين بأي تغييرات محتملة من خلال وسائل الاتصال في التطبيق.',
  'Add Item': 'اضافة عنصر',
